-- ----------------------------
-- Table structure for member
-- ----------------------------
DROP TABLE IF EXISTS `member`;
CREATE TABLE `member`  (
  `member_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `membership_number` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会员号',
  `nick_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会员昵称',
  `real_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '真实姓名',
  `phonetic` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '真实姓名拼音',
  `mobile` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `pwd_salt` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '密碼鹽',
  `password` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '密码',
  `gender` tinyint(1) NOT NULL DEFAULT 0 COMMENT '性别 0未知 1男 2女',
  `is_new` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否是新会员 1是0否',
  `birthday` date NOT NULL COMMENT '生日',
  `email` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '邮箱',
  `email_type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '邮箱 发送形式  1 文本 2 HTML',
  `receive_mail` tinyint(1) NOT NULL DEFAULT 1 COMMENT '收宣传邮件 1 收,0 不收',
  `source` tinyint(1) NOT NULL DEFAULT 0 COMMENT '来源 0前台注册，1后台添加',
  `height` int(3) NOT NULL DEFAULT 0 COMMENT '身高cm',
  `weight` decimal(5, 1) NOT NULL DEFAULT 0.0 COMMENT '体重kg',
  `pic` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '照片',
  `avatar` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '头像',
  `city` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '市',
  `area` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '县/区',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '详细地址',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '会员类型 0假登录(没有验证邮箱) 1有效会员(没有验证手机号码的用户) 2有效会员(没有买卡或套餐的用户,以前買過卡,但是退掉了或者到期了) 3有效会员(買了卡或者套餐)  4无效会员(多个月未缴纳费用,管理员设置,用户不能登录)  5退会',
  `is_due` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否已缴纳入会费 0 沒有繳納   1 已繳納  2 免除繳納',
  `phone_call` tinyint(1) NOT NULL DEFAULT 1 COMMENT '需要验证手机 1需要 0不需要',
  `appointment_stop` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否停止预约 0不停止，1停止',
  `login_stop` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否禁止登录 0不禁止，1禁止',
  `inviter_id` int(11) NOT NULL DEFAULT 0 COMMENT '邀请人ID',
  `store_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '所属门店ID',
  `credit_card` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '信用卡号',
  `security_code` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '信用卡安全码',
  `credit_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '信用卡持卡人姓名',
  `credit_validity` date NOT NULL COMMENT '信用卡有效期',
  `bank_card` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '银行卡号',
  `free_explain_date` date NOT NULL COMMENT ' 免费说明会参加日',
  `free_experience_date` date NOT NULL COMMENT ' 免费体验参加日',
  `add_at` date NOT NULL COMMENT '入会日 即第一次购买卡的时间',
  `last_login_time` int(11) NOT NULL DEFAULT 0 COMMENT '最后一次登录时间',
  `created_at` datetime(0) DEFAULT NULL COMMENT '注册时间',
  `updated_at` datetime(0) DEFAULT NULL,
  PRIMARY KEY (`member_id`) USING BTREE,
  UNIQUE INDEX `uni_number`(`membership_number`) USING BTREE,
  INDEX `normal_mobile`(`mobile`) USING BTREE,
  INDEX `normal_email`(`email`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '会员信息表' ROW_FORMAT = Dynamic;

SET FOREIGN_KEY_CHECKS = 1;
